    data: |
      SELECT DISTINCT cor1.col2 + cor1.col1 + 69 AS col2 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q7305.out
    data: |
      124
      127
      154
